    <p><b>일련번호</b>: SCP-3125</p>
    <p><b>등급</b>: 케테르</p>
    <p><b>특수 격리 절차</b>: SCP-3125는 제41기지 1층의 제3125인식재해격리단위 내에 보관되어 있다. 이 격리단위는 10 m × 15 m × 3 m의 입방형 방으로, 내벽이 납으로 발라져 있고 방음 및 텔레파시 차폐 처리가 되어 있다. 접근하기 위해서는 격리단위 한쪽 끝의 에어락 시스템을 통해야 한다. 이 에어락은 한 번에 한 사람만 격리단위 안으로 들여보내며, 먼저 들어간 사람이 나오기 전까지 잠김으로써 다른 사람이 들어가는 것을 막는다.</p>
    <p>어떠한 상황에서도 논리정합적인 정보가 격리단위를 벗어나서는 안 된다. 논리정합적 정보란 전자기록, 사진, 녹음, 녹화, 소리, 전자기 및 입자신호, 사이오닉 에마네이션을 포함한다. 격리단위에서 나올 때는 에어록에 부설된 숙청 시스템이 작동하여 3분간 에어록 내부에 기억소거 기체를 가득 채움으로써 해당자의 기억을 씻어내린다.</p>
    <p>항밈학과 선임 직원이 SCP-3125를 매 6주(42일)에 한번씩 방문해야 한다.</p>
